const SubjectSelection = ()=> {
    return(
        <div style={{
            display: 'flex',
            flexDirection: 'column',
            border: '1px solid black',
            padding: '10px',
            borderRadius: '5px',
        }}>
            <h3>Select subject</h3>
            <div>
                <div>Physics</div>
                <div>Chemistry</div>
                <div>Mathematics</div>
            </div>
        </div>
    )
}

export default SubjectSelection;
